  false,\n\t\"url\": null,\n\t\"notes\": \"This report summarizes the findings necessary
  to develop the initial stages of a computerized Alaskan Information Management System.
  To provide a starting point for information gathering, the FWS contracted WoodwardClyde
  Consultants to inventory major recently completed or ongoing projects in the Southcentral
  Alaska area. Specifically, the objective of the project was to identify, describe,
  and document major recently completed within the last three years, ongoing, and
  planned development projects which could significantly affect fish and wildlife
  and their habitats in southcentral Alaska, including Bristol Bay.\",\n\t\"license_title\":
